    segments = [list(map(int, line.split())) for line in lines[1:1+n]]

    def find_intersection(segments):
        segments.sort(key=lambda x: x[0])
        if len(segments) < 2:
            return []

        intersection = []
        i, j = 0, 1
        while j < len(segments):
            if segments[i][1] >= segments[j][0]:
                intersection.append(segments[i])
                i += 1
            else:
                intersection.append(segments[j])
                j += 1

        intersection.append(segments[i])
        return intersection

    def find_max_length(segments):
        if len(segments) < 2:
            return 0

        intersection = find_intersection(segments)
        return max(0, intersection[-1][1] - intersection[0][0])

    return str(find_max_length(segments))

