    s = stdin.split()[1]

    def backtrack(start: int, s: str, cost: int, k: int, index: int, result: list):
        if index == k:
            result.append(cost)
            return

        if index > k:
            return

        for i in range(start, len(s)):
            if i == start or s[i]!= s[i - 1]:
                backtrack(i + 1, s, cost, k, index + 1, result)

    result = []
    backtrack(0, s, 0, k, 0, result)

    if not result:
        return -1

    result.sort()
    return str(result[0])


