        for j in range(1, m):
            matrix[i][j] = (i - 1) * m + j

    # Perform the cyclic shift
    for _ in range(min(n * m - 1, m)):
        for j in range(1, m):
            matrix[0][j], matrix[n - 1][j] = matrix[n - 1][j], matrix[0][j]

    # Find the minimum number of moves
    moves = 0
    for i in range(n):
        for j in range(m):
            if matrix[i][j]!= i * m + j:
                moves += 1
                break

