        def get_next_kid(kid_id: int) -> int:
            if kid_id < n:
                return kid_id + 1
            else:
                return 1

        def get_kid_for_kid(kid_id: int) -> int:
            next_kid = get_next_kid(kid_id)
            if next_kid == n:
                next_kid = 1
            return next_kid

        def is_cyclic_shift(permutation: List[int]) -> bool:
            return permutation == list(range(1, n + 1))

        def restore_permutation_helper(kids_information: List[List[int]]) -> List[int]:
            def get_min_kid_id() -> int:
                return min(map(get_next_kid, range(n)))

            def dfs(kid_id: int, start_kid_id: int, min_kid_id: int) -> List[int]:
                if kid_id == n:
                    return [start_kid_id]

                visited = [False] * (n + 1)
                visited[start_kid_id] = True
                result = [start_kid_id]

                for kid in kids_information[start_kid_id]:
                    next_kid = get_next_kid(kid)
                    if not visited[next_kid]:
                        visited[next_kid] = True
                        result += dfs(kid_id, next_kid, min_kid_id)

                if result[-1] == min_kid_id:
                    return []

                result.pop()
                return result

            min_kid_id = get_min_kid_id()
            start_kid_id = min_kid_id
            return dfs(start_kid_id, start_kid_id, min_kid_id)

        permutation = restore_permutation_helper(kids_information)
        return permutation

    permutation = restore_permutation(kids_information)
