        return sock_type(sock1) == sock_type(sock2)

    def move_from_top(piles: List[int]) -> List[int]:
        return piles[1:] + [piles[0]]

    def move_to_top(piles: List[int]) -> List[int]:
        return [piles[0]] + piles[1:]

    def pair_socks(piles: List[int]) -> int:
        if len(piles) == 1:
            return 0
        if len(piles) == 2:
            return 1
        piles = move_to_top(piles)
        move1 = pair_socks(piles)
        piles = move_from_top(piles)
        move2 = pair_socks(piles)
        if can_pair(piles[0], piles[1]):
            return move1 + move2 + 1
        else:
            return min(move1, move2) + 1

    if all(can_pair(i, i + 1) for i in range(1, 2 * n)):
        return str(pair_socks([i for i in range(1, 2 * n + 1)]))
    else:
