    n, k = map(int, stdin.split())
    samples = stdin.split('\n')[1:]
    def compute_unlikelihood(edge_weights):
        return sum(edge_weights)

    def build_tree(samples, unlikelihood):
        root = 0
        tree = [root]
        seen = set()
        while tree:
            u = tree.pop(0)
            if u in seen:
                continue
            seen.add(u)
            for v, edge_weight in enumerate(unlikelihood):
                if edge_weight == unlikelihood[u]:
                    child = u * 2 + v
                    tree.append(child)
        return tree

    def count_unlikelihood(tree, seen, unlikelihood):
        if len(tree) == 1:
            return 0
        u, v = tree[-1]
        if (u, v) in seen:
            return 0
        seen.add((u, v))
        edge_weight = unlikelihood[u] + 1
        return edge_weight + count_unlikelihood(tree, seen, unlikelihood)

    def is_valid_tree(tree, unlikelihood):
        seen = set()
        return count_unlikelihood(tree, seen, unlikelihood) == len(tree) * 2

    edge_weights = [1] * (n - 1)
    unlikelihood = compute_unlikelihood(edge_weights)
    tree = build_tree(samples, unlikelihood)
    if is_valid_tree(tree, unlikelihood):
        print(unlikelihood)
        for u, v in tree:
