    rows, cols = map(int, stdin.split()[0].split())
    puzzle = [list(row.strip()) for row in stdin.split()[1:].split('\n')]

    def find_word(word: str, start: tuple, direction: int) -> str:
        row, col = start
        if row < 0 or row >= rows or col < 0 or col >= cols or puzzle[row][col]!= '#':
            return ''

        puzzle[row][col] = word[0]
        if len(word) == 1:
            return word

        result = find_word(word[1:], (row + direction, col), direction)
        if result:
            return word[0] + result
        else:
            puzzle[row][col] = '#'
            return ''

    words = set()
    for row in range(rows):
        for col in range(cols):
            if puzzle[row][col]!= '#':
                words.add(find_word(puzzle[row][col], (row, col), 0))
                words.add(find_word(puzzle[row][col], (row, col), 1))

    return min(words, key=lambda w: w)


