    t = int(stdin.split()[3])

    # generate all possible combinations of ants
    combs = set()
    for i in range(n1 + 1):
        for j in range(n2 + 1):
            combs.add((order1[i], j))
            combs.add((order2[j], i))

    # generate all possible combinations of jumps
    jumps = set()
    for (c1, i1), (c2, i2) in combinations(combs, 2):
        if (c1 == c2)!= (i1 > i2):
            jumps.add((c1, i1, i2))

    # find the jump that takes us from the start to the end in $T$ seconds
    time = 0
    ans = ''
    for c, i, j in sorted(jumps):
        if time + j <= t:
            time += j
            ans = c * (i + 1) + ans
        else:
            break

    # find the remaining ants in the end
    remaining = [0] * 2
    for c, i in combs:
        if c == ans[i]:
            remaining[i] += 1

    # find the order of the remaining ants
    order = ''
    for r in remaining:
        order += order1[r - 1]

    return order

