    dp = [[float('inf')] * (N + 1) for _ in range(M + 1)]
    dp[1][1] = 0

    # Fill the DP table
    for i in range(1, M + 1):
        for j in range(1, N + 1):
            if heights[i - 1][j - 1] > heights[i][j]:
                dp[i][j] = min(dp[i - 1][j - 1], dp[i - 1][j]) + heights[i][j]
            else:
                dp[i][j] = min(dp[i - 1][j], dp[i][j - 1])

    # Find the shortest path
    shortest_path = []
    for i in range(M, -1, -1):
        for j in range(N, -1, -1):
            if heights[i][j] == dp[i][j]:
                shortest_path.append((i, j))
                break
    shortest_path.reverse()

    # Calculate the length of the shortest path
    shortest_length = sum(heights[i][j] for i, j in shortest_path[1:])

    return str(shortest_length)

