    m = len(v)

    # Find the minimum degree of a polynomial that produces the original sequence
    degree = m
    for i in range(1, m):
        for j in range(i + 1, m + 1):
            p1 = sum([v[k] * x ** k for k in range(i + 1)])
            p2 = sum([v[k] * x ** k for k in range(j)])
            if abs(p2 - p1) < abs(p2 - degree * p1):
                degree = j - i + 1

    # Find the value of the polynomial if evaluated at the next regularly spaced input value
    x_next = v[-1]
    if abs(x_next - 1) <= 1e-10:
        x_next = 1
    elif abs(x_next - 2) <= 1e-10:
        x_next = 2
    elif abs(x_next - 3) <= 1e-10:
        x_next = 3

    p_next = sum([v[k] * x_next ** k for k in range(degree + 1)])

    return f"{degree} {p_next:.10f}"

