    distances = {1: 0}

    while queue:
        x, y, distance = queue.pop(0)
        visited.add((x, y))

        for dx, dy in [(0, 1), (1, 0), (0, -1), (-1, 0)]:
            next_x, next_y = x + dx, y + dy

            if 1 <= next_x <= n and 1 <= next_y <= n and next_x!= x and next_y!= y and (next_x, next_y) not in visited:
                if matrix[next_x-1][next_y-1] == k:
                    return -1
                elif matrix[next_x-1][next_y-1] == matrix[x-1][y-1]:
                    new_distance = distance + abs(next_x - x) + abs(next_y - y)
                    if (next_x, next_y) not in distances or new_distance < distances[(next_x, next_y)]:
                        distances[(next_x, next_y)] = new_distance
                        queue.append((next_x, next_y, new_distance))

    return sum(distances.values())

